import { add, sub, div, mul } from "./App.jsx";
import "./index.css";
ReactDOM.render(
  <div>
    <ul>
      <li> Sum of two numbers is {add(10, 30)}</li>
      <li> Sub of two numbers is {sub(40, 8)}</li>
      <li> Div of two numbers is {div(20, 3)}</li>
      <li> Multiplication sum of two numbers is {mul(10, 3)}</li>
    </ul>
  </div>,
  document.getElementById("root")
);
